B.x2=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u5beb\u7a0b\u5f0f\u6642\uff0c\u5f80\u5f80\u6642\u9593\u4e00\u4e45\u5c31\u6703\u5fd8\u8a18\u5148\u524d\u7684\u7a0b\u5f0f\u78bc\u70ba\u4ec0\u9ebc\u8981\u90a3\u6a23\u5beb\u3002\u7a0b\u5f0f\u78bc\u6709\u6e05\u695a\u7684\u8a3b\u89e3\uff0c\u53ef\u4ee5\u8a3b\u8a18\u4e00\u6bb5\u7a0b\u5f0f\u78bc\u7684\u4f5c\u7528\u3001\u76ee\u7684\u3001\u6ce8\u610f\u4e8b\u9805\u3002\u900f\u904e\u8a3b\u89e3\u4e0d\u50c5\u65b9\u4fbf\u81ea\u5df1\u9577\u671f\u7dad\u8b77\u7a0b\u5f0f\u78bc\uff0c\u4e5f\u80fd\u5e6b\u52a9\u5176\u4ed6\u4eba\u7406\u89e3\u7a0b\u5f0f\u78bc\u3002"},\n    {"type" : 2, "content" : "JavaScript \u4f7f\u7528\u96d9\u659c\u7dda (//) \u9032\u884c\u55ae\u884c\u8a3b\u89e3\uff0c\u5f9e // \u5230\u884c\u672b\u7684\u6587\u5b57\u90fd\u8996\u70ba\u8a3b\u89e3\u3002"},\n    {"type" : 1, "content" : "\u8a3b\u89e3\u662f\u5beb\u7d66\u4eba\u770b\u7684\uff0c\u96fb\u8166\u5728\u57f7\u884c\u6642\u6703\u5ffd\u7565\u7a0b\u5f0f\u78bc\u7576\u4e2d\u7684\u8a3b\u89e3\u3002"}]}',null)
B.x3=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u5728\u96fb\u8166\u79d1\u5b78\u9818\u57df\uff0c\u6709\u4e9b\u7a0b\u5f0f\u8a9e\u8a00\u540c\u6642\u5141\u8a31\u4f7f\u7528\u55ae\u5f15\u865f\u5b57\u4e32\u8207\u96d9\u5f15\u865f\u5b57\u4e32\uff0c\u4f8b\u5982 JavaScript\u3001Python\u3002\u6709\u4e9b\u7a0b\u5f0f\u8a9e\u8a00\uff0c\u55ae\u5f15\u865f\u8207\u96d9\u5f15\u865f\u64c1\u6709\u4e0d\u540c\u7684\u610f\u7fa9\uff0c\u4f8b\u5982 C \u6216 C++\uff0c\u55ae\u5f15\u865f\u7528\u65bc\u8868\u9054\u55ae\u4e00\u500b\u5b57\u5143\uff0c\u96d9\u5f15\u865f\u7528\u65bc\u8868\u9054\u5b57\u4e32\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u90a3\u9ebc\uff0c\u5728\u50c5\u80fd\u4f7f\u7528\u96d9\u5f15\u865f\u5b57\u4e32\u7684\u7a0b\u5f0f\u8a9e\u8a00\uff0c\u8981\u5982\u4f55\u5728\u5b57\u4e32\u5167\u986f\u793a\u96d9\u5f15\u865f\u5462\uff1f\u53c8\u6216\u8005\u5728 JavaScript \u7684\u5b57\u4e32\u5167\uff0c\u5982\u679c\u540c\u6642\u6709\u55ae\u5f15\u865f\u53c8\u6709\u96d9\u5f15\u865f\uff0c\u5247\u7121\u8ad6\u4f7f\u7528\u54ea\u7a2e\u5b57\u4e32\u90fd\u6703\u9020\u6210\u5f15\u865f\u914d\u5c0d\u932f\u8aa4\u3002\u6240\u4ee5\uff0c\u9084\u9700\u8981\u5176\u4ed6\u65b9\u6cd5\uff0c\u4f86\u89e3\u6c7a\u5b57\u4e32\u5167\u5bb9\u9020\u6210\u5f15\u865f\u914d\u5c0d\u7684\u554f\u984c\u3002"}]}',null)
B.x4=new A.a9('{ "items" : [\n    {"type" : 2, "content" : "\u5728\u985e\u5225\u4e2d\u5b9a\u7fa9\u65b9\u6cd5\uff0c\u4e0d\u9700\u8981\u4f7f\u7528 function \u6307\u4ee4\u3002\u5b9a\u7fa9\u65b9\u6cd5\u7684\u65b9\u5f0f\u5982\u4e0b\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 2, "content" : "          \u65b9\u6cd5\u540d\u7a31 (\u53c3\u6578\u2026 \u2026) {"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 2, "content" : "              // \u7a0b\u5f0f\u78bc"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 2, "content" : "          }"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u4f8b\u5982\uff0c\u5b9a\u7fa9\u9577\u65b9\u5f62\u985e\u5225 Rectangle\uff0c\u64c1\u6709\u8a08\u7b97\u9577\u65b9\u5f62\u9762\u7a4d\u7684\u65b9\u6cd5 area()\uff0c\u5982\u4e0b\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          class Rectangle {"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              // \u5efa\u69cb\u5f0f\uff0c\u5ba3\u544a\u9577\u65b9\u5f62\u985e\u5225\u7684\u5c6c\u6027"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              constructor (w = 10, h = 10) {"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "                  this.width = w;"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "                  this.height = h;"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              }"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "              // \u65b9\u6cd5 area()\uff0c\u8a08\u7b97\u9577\u65b9\u5f62\u9762\u7a4d"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              area() {"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "                  return this.width * this.height;"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              }"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          }"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 2, "content" : "\u5728\u4ee3\u8868\u7269\u4ef6\u7684\u8b8a\u6578\u5f8c\uff0c\u904b\u7528\u9ede\u7b26\u865f (.) \u5373\u53ef\u4f7f\u7528\u8a72\u985e\u5225\u7684\u65b9\u6cd5\u3002"},\n    {"type" : 1, "content" : "\u4f8b\u5982\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          x.area(); // \u9577\u65b9\u5f62\u7269\u4ef6 x \u7684\u5bec\u8207\u9ad8\u90fd\u662f 10\uff0c\u6240\u4ee5 x.area() \u7684\u503c\u662f 100"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          y.area(); // \u9577\u65b9\u5f62\u7269\u4ef6 y \u7684\u5bec\u8207\u9ad8\u662f 15 \u8207 20\uff0c\u6240\u4ee5 y.area() \u7684\u503c\u662f 300"}]}',null)
B.x5=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u5728\u524d\u9762\u7684\u8ab2\u7a0b\u88e1\uff0c\u6211\u5011\u5b78\u5230\u6578\u503c\u8207\u5b57\u4e32\u662f\u4e0d\u540c\u7684\u8cc7\u6599\u578b\u614b\u3002\u4e26\u4e14\uff0c\u6578\u503c\u5167\u5bb9\u76f4\u63a5\u6253\u6578\u5b57\u5373\u53ef\uff0c\u4f8b\u5982\uff0c12345\u3002\u5b57\u4e32\u5167\u5bb9\u5247\u8981\u653e\u5230\u96d9\u5f15\u865f\u4e4b\u5167\uff0c\u4f8b\u5982 \\"\u4f60\u597d\\"\u3002\u9019\u4e00\u7bc0\u8981\u6df1\u5165\u63a2\u8a0e\u5b57\u4e32\uff0c\u8b93\u5b57\u4e32\u80fd\u8868\u9054\u66f4\u591a\u7684\u5167\u5bb9\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u9996\u5148\u8981\u6559\u7684\u662f\u5728\u5b57\u4e32\u5167\u8868\u9054\u96d9\u5f15\u865f(\\")\u3002\u4ee5\u96d9\u5f15\u865f\u593e\u4f4f\u5b57\u4e32\u5167\u5bb9\uff0c\u90a3\u9ebc\u96d9\u5f15\u865f\u593e\u7684\u5b57\u4e32\u5167\u5982\u679c\u60f3\u8981\u8868\u9054\u96d9\u5f15\u865f\uff0c\u4f8b\u5982 \\"\u4f60\\"\u597d\\" \u5c31\u6703\u9020\u6210\u96fb\u8166\u4e0d\u77e5\u9053\u8981\u7528\u54ea\u5169\u500b\u96d9\u5f15\u865f\u914d\u5c0d\u6210\u5b57\u4e32\u3002\u89e3\u6c7a\u8fa6\u6cd5\u662f"},\n    {"type" : 2, "content" : "\u53e6\u4e00\u7a2e\u8868\u9054\u5b57\u4e32\u7684\u65b9\u5f0f\uff1a\u4ee5\u55ae\u5f15\u865f (\') \u593e\u4f4f\u6709\u96d9\u5f15\u865f\u7684\u5b57\u4e32\u3002\u4f8b\u5982 \'\u4f60\\"\u597d\'\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u55ae\u5f15\u865f\u5b57\u4e32\u6216\u96d9\u5f15\u865f\u5b57\u4e32\u7684\u4f7f\u7528\u6642\u6a5f\uff0c\u4f9d\u7167\u5b57\u4e32\u5167\u5bb9\u6c7a\u5b9a\u3002\u7576\u5b57\u4e32\u5167\u5bb9\u6709\u96d9\u5f15\u865f \\" \u6642\uff0c\u4f7f\u7528\u55ae\u5f15\u865f\u5b57\u4e32\uff1b\u7576\u5b57\u4e32\u5167\u5bb9\u6709\u55ae\u5f15\u865f\u6642\uff0c\u4f7f\u7528\u96d9\u5f15\u865f\u5b57\u4e32\u3002"}]}',null)
B.x6=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u5728\u9019\u4e00\u7bc0\u7684\u8ab2\u7a0b\u88e1\uff0c\u6211\u5011\u8a8d\u8b58\u4ee5 for \u6307\u4ee4\u63a7\u5236\u8ff4\u5708\u6d41\u7a0b\u3002for \u6307\u4ee4\uff0c\u5c07\u63a7\u5236\u8ff4\u5708\u7684\u8ff4\u5708\u689d\u4ef6\u5f0f\u3001\u689d\u4ef6\u521d\u59cb\u5316\u3001\u689d\u4ef6\u8b8a\u5316\u5beb\u5728\u4e00\u8d77\u3002\u53ef\u4ee5\u66f4\u7cbe\u7c21\u5730\u64b0\u5beb\u8ff4\u5708\u7a0b\u5f0f\u78bc\u3002"}]}',null)
B.x7=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u8b8a\u6578\u662f\u5132\u5b58\u8cc7\u6599\u7684\u5bb9\u5668\uff0c\u8cc7\u6599\u6709\u4e0d\u540c\u7684\u7a2e\u985e\uff0c\u76ee\u524d\u6211\u5011\u8a8d\u8b58\u4e86\u5169\u7a2e\u985e\u578b\u7684\u8cc7\u6599\uff1a\u6578\u503c (Number) \u8207\u5b57\u4e32 (String)\u3002"},\n    {"type" : 2, "content" : "\u8b8a\u6578\u5132\u5b58\u54ea\u7a2e\u985e\u578b\u7684\u8cc7\u6599\uff0c\u6c7a\u5b9a\u8b8a\u6578\u7684\u578b\u5225 (type)\u3002"},\n    {"type" : 1, "content" : "\u4f8b\u5982\uff0c\u8b8a\u6578 x = 100 \u5247 x \u7684\u578b\u5225\u662f\u6578\u503c (Number)\uff0c\u8b8a\u6578 y = \\"100\\" \u5247 y \u7684\u578b\u5225\u662f\u5b57\u4e32 (String)\u3002"},\n    {"type" : 2, "content" : "\u7a0b\u5f0f\u5c0d\u4e0d\u540c\u7684\u8cc7\u6599\u578b\u5225\u6709\u4e0d\u540c\u7684\u904b\u7b97\u65b9\u5f0f\u3002"},\n    {"type" : 1, "content" : "\u4f8b\u5982\u6578\u503c\u8cc7\u6599\u7684\u52a0\u6cd5\uff0c\u5c31\u662f\u6578\u5b78\u52a0\u6cd5\u8a08\u7b97\u3002\u5b57\u4e32\u8cc7\u6599\u7684\u52a0\u6cd5\uff0c\u5247\u662f\u5c07\u5169\u500b\u5b57\u4e32\u929c\u63a5\u6210\u4e00\u500b\u66f4\u9577\u7684\u5b57\u4e32\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u6578\u503c\u8207\u5b57\u4e32\u53ef\u4ee5\u900f\u904e\u6307\u4ee4\u8f49\u63db\u8cc7\u6599\u578b\u5225\u3002"},\n    {"type" : 2, "content" : "Number() \u6307\u4ee4\u5c07\u5b57\u4e32\u8f49\u70ba\u6578\u503c\uff0c"},\n    {"type" : 1, "content" : "\u6307\u4ee4\u7684\u4f7f\u7528\u65b9\u5f0f\u5982\u4e0b\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 2, "content" : "          \u6578\u503c\u8b8a\u6578 = Number( \u5b57\u4e32 );"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u4f8b\u5982\u4e0b\u9762\u7684\u7a0b\u5f0f\u78bc\u4f7f\u7528 Number() \u6307\u4ee4\u5c07\u5b57\u4e32\u8f49\u70ba\u6578\u503c\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let x = \\"100\\"; // x \u7684\u8cc7\u6599\u578b\u5225\u662f\u5b57\u4e32 (String)"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let y = Number( x );"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let z = Number( \\"100\\" );"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 2, "content" : "String() \u6307\u4ee4\u5c07\u6578\u503c\u8f49\u70ba\u5b57\u4e32\uff0c"},\n    {"type" : 1, "content" : "\u6307\u4ee4\u7684\u4f7f\u7528\u65b9\u5f0f\u5982\u4e0b\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 2, "content" : "          \u5b57\u4e32\u8b8a\u6578 = String( \u6578\u503c );"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u4f8b\u5982\u4e0b\u9762\u7684\u7a0b\u5f0f\u78bc\u4f7f\u7528 String() \u6307\u4ee4\u5c07\u6578\u503c\u8f49\u70ba\u5b57\u4e32\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let x = 100; // x \u7684\u8cc7\u6599\u578b\u5225\u662f\u6578\u503c (Number)"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let y = String( x );"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let z = String( 100 );"}]}',null)
