B.xy=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u4eba\u7684\u50f9\u503c\u7121\u5f9e\u6bd4\u8f03\uff0c\u4f46\u91d1\u878d\u8ca1\u52d9\u8a08\u7b97\u53ef\u662f\u4e00\u5143\u90fd\u8981\u7cbe\u6e96\u7684\u8a08\u8f03\uff0c\u8001\u95c6\u8ce3\u6771\u897f\u7684\u61c9\u6536\u5e33\u6b3e\uff0c\u8981\u7b49\u65bc\u9867\u5ba2\u8cb7\u6771\u897f\u7684\u61c9\u4ed8\u5e33\u6b3e\u3002\u904b\u52d5\u7cbe\u795e\u7121\u5f9e\u6bd4\u8f03\uff0c\u4f46\u904b\u52d5\u6210\u7e3e\u53ef\u662f\u5206\u5206\u90fd\u8981\u8a08\u8f03\uff0c\u6bcf\u5834\u6bd4\u8cfd\u596a\u5f97\u6700\u9ad8\u5206\u7684\u51a0\u8ecd\u53ea\u6709\u4e00\u4f4d\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u524d\u9762\u7684\u8ab2\u7a0b\u6559\u5c0e\u4f7f\u7528 JavaScript \u9032\u884c\u56db\u5247\u904b\u7b97\uff0c\u7b97\u51fa\u67d0\u500b\u6578\u503c\uff0c\u9019\u4e00\u7bc0\u8981\u6559\u5c0e\u6578\u503c\u6bd4\u8f03\u3002"},\n    {"type" : 2, "content" : "\u5c0d\u5169\u500b\u6578\u503c\u9032\u884c\u6bd4\u8f03\uff0c\u5c31\u662f\u8a62\u554f\u67d0\u500b\u6bd4\u8f03\u7d50\u679c\u662f\u4e0d\u662f\u771f\u7684\uff0c\u5f97\u5230 true (\u771f) \u6216 false (\u5047) \u5169\u7a2e\u7d50\u679c\u3002"},\n    {"type" : 1, "content" : "\u4f8b\u5982\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          \u4e09\u5927\u65bc\u4e94\u662f\u771f\u7684\u55ce\uff1ffalse (\u5047\u7684)"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          \u4e09\u5c0f\u65bc\u4e94\u662f\u771f\u7684\u55ce\uff1ftrue (\u771f\u7684)"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "JavaScript \u4e3b\u8981\u7684\u6bd4\u8f03\u904b\u7b97\u5b50\u5982\u4e0b\u8868\uff1a"}]}',null)
B.xz=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u73fe\u5728\uff0c\u8b93\u6211\u5011\u5c07\u9577\u65b9\u5f62\u7684\u5bec\u8207\u9ad8\uff0c\u4ee5\u53ca\u8a08\u7b97\u9577\u65b9\u5f62\u9762\u7a4d\u7684\u51fd\u5f0f\u7d81\u5728\u4e00\u8d77\u3002\u5047\u8a2d\u9577\u65b9\u5f62\u5c31\u50cf\u6578\u503c\u6216\u5b57\u4e32\u4e00\u6a23\uff0c\u662f\u67d0\u7a2e\u8cc7\u6599\u578b\u614b\uff0c\u8b93\u8b8a\u6578\u53ef\u4ee5\u5ba3\u544a\u6210\u9577\u65b9\u5f62\u9019\u7a2e\u578b\u614b\uff0c\u4e26\u4e14\u4f7f\u7528\u9ede\u7b26\u865f (.) \u5c31\u53ef\u4ee5\u53d6\u7528\u9577\u65b9\u5f62\u7684\u5c6c\u6027\u8207\u51fd\u5f0f\u3002\u90a3\u9ebc\uff0c\u9577\u65b9\u5f62\u7684\u7a0b\u5f0f\u78bc\u5c07\u50cf\u4ee5\u4e0b\u7684\u865b\u64ec\u78bc\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let a =\u9577\u65b9\u5f62, b = \u9577\u65b9\u5f62; // \u5ba3\u544a a, b \u5169\u500b\u8b8a\u6578\u70ba\u9577\u65b9\u5f62"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          a.\u5bec = 5; a.\u9ad8 = 10;      // \u6307\u6d3e\u9577\u65b9\u5f62 a \u7684\u5bec\u8207\u9ad8"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          b.\u5bec = 15; b.\u9ad8 = 25;     // \u6307\u6d3e\u9577\u65b9\u5f62 b \u7684\u5bec\u8207\u9ad8"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let x = a.\u9762\u7a4d(), y = b.\u9762\u7a4d();  // \u5ba3\u544a\u8b8a\u6578 x, y \u5206\u5225\u70ba\u9577\u65b9\u5f62 a, b \u7684\u9762\u7a4d"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u4ee5\u4e0a\u865b\u64ec\u78bc\uff0c\u5bec\u8207\u9ad8\u90fd\u662f\u8ddf\u8457\u9577\u65b9\u5f62\u5728\u4e00\u8d77\uff0c\u4e0d\u662f\u7368\u7acb\u65bc\u9577\u65b9\u5f62\u5916\u7684\u8b8a\u6578\u3002\u8a08\u7b97\u9762\u7a4d\u7684\u51fd\u5f0f\u4e5f\u662f\u8ddf\u8457\u9577\u65b9\u5f62\uff0c\u4e0d\u662f\u67d0\u500b\u5c07\u5169\u500b\u8b8a\u6578\u76f8\u4e58\u5f8c\u56de\u50b3\u503c\u7684\u51fd\u5f0f\u3002\u9019\u6a23\u7684\u7a0b\u5f0f\u8a2d\u8a08\u65b9\u5f0f\uff0c\u66f4\u50cf\u73fe\u5be6\u751f\u6d3b\uff0c\u66f4\u6613\u65bc\u8b93\u4eba\u7406\u89e3\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u6240\u8b02\u7684"},\n    {"type" : 2, "content" : "\u7269\u4ef6 (object) \u5c31\u662f\u5728\u7a0b\u5f0f\u88e1\u6a21\u64ec\u771f\u5be6\u4e16\u754c\u7684\u6982\u5ff5\u3002"},\n    {"type" : 1, "content" : "\u4ee5\u524d\u4f8b\u4f86\u8aaa\uff0c\u7a0b\u5f0f\u8a2d\u8a08\u9577\u65b9\u5f62\u7269\u4ef6\u5c31\u662f\u904b\u7528\u7a0b\u5f0f\u6a21\u64ec\u9577\u65b9\u5f62\u7684\u6982\u5ff5\u3002"},\n    {"type" : 2, "content" : "\u7269\u4ef6\u5c0e\u5411\u7a0b\u5f0f\u8a2d\u8a08\uff0c\u5c31\u662f\u5c07\u7a0b\u5f0f\u5206\u62c6\u6210\u591a\u500b\u6982\u5ff5\u5b8c\u6574\u7684\u7269\u4ef6\uff0c\u7136\u5f8c\u7531\u7269\u4ef6\u7d44\u5408\u6210\u5b8c\u6574\u7684\u7a0b\u5f0f\u3002"},\n    {"type" : 1, "content" : "\u7269\u4ef6\u5c0e\u5411\u7a0b\u5f0f\u8a2d\u8a08\u8207\u6a21\u7d44\u5316\u7a0b\u5f0f\u8a2d\u8a08\u76f8\u4f3c\uff0c\u4f46\u7269\u4ef6\u5c0e\u5411\u7a0b\u5f0f\u8a2d\u8a08\u591a\u4e86\u6a21\u64ec\u771f\u5be6\u4e16\u754c\u7684\u6982\u5ff5\uff0c\u8b93\u7a0b\u5f0f\u8a2d\u8a08\u66f4\u76f4\u89ba\u5730\u7b26\u5408\u751f\u6d3b\u7d93\u9a57\u3002"}]}',null)
B.xA=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u51fd\u6578\u8207\u51fd\u5f0f\u7684\u82f1\u6587\u55ae\u5b57\u90fd\u662f function\u3002\u53ea\u662f\u5728\u6578\u5b78\u9818\u57df\uff0c\u51fd\u6578\u7684\u8f38\u5165\u3001\u8f38\u51fa\u8cc7\u6599\u90fd\u662f\u6578\u503c\uff1b\u5728\u96fb\u8166\u79d1\u5b78\u9818\u57df\uff0c\u51fd\u5f0f\u7684\u8f38\u5165\u3001\u8f38\u51fa\u8cc7\u6599\u4e0d\u50c5\u662f\u6578\u503c\uff0c\u53ef\u4ee5\u662f\u5b57\u4e32\u6216\u5176\u4ed6\u578b\u5225\u3002\u70ba\u4e86\u5340\u5225\u6578\u5b78\u8207\u96fb\u8166\u79d1\u5b78\u9818\u57df\uff0c\u672c\u8ab2\u7a0b\u4e00\u5f8b\u4f7f\u7528\u300c\u51fd\u5f0f\u300d\u9019\u500b\u8853\u8a9e\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 2, "content" : "\u6a21\u7d44\u5316\u7a0b\u5f0f\u8a2d\u8a08\u662f\u91cd\u8981\u7684\u904b\u7b97\u601d\u7dad\uff0c\u5b83\u7684\u6982\u5ff5\u662f\u5c07\u7a0b\u5f0f\u6574\u9ad4\u7684\u529f\u80fd\u62c6\u89e3\u70ba\u591a\u500b\u7368\u7acb\u7684\u7a0b\u5f0f\u500b\u9ad4\u4f86\u7d44\u6210\u3002"},\n    {"type" : 1, "content" : "\u7528\u6210\u8a9e\u4f86\u8209\u4f8b\uff0c\u300c\u585e\u7fc1\u5931\u99ac\u300d\u662f\u500b\u5b8c\u6574\u800c\u7368\u7acb\u7684\u5c0f\u6545\u4e8b\u3002\u5beb\u4f5c\u6587\u6642\uff0c\u5982\u679c\u628a\u5c0f\u6545\u4e8b\u5beb\u4e09\u904d\uff0c\u6050\u6015\u6703\u8b93\u6587\u7ae0\u5197\u9577\u4e14\u96e3\u4ee5\u95b1\u8b80\u3002\u82e5\u5c07\u5c0f\u6545\u4e8b\u6a21\u7d44\u5316\u70ba\u6210\u8a9e\uff0c\u5beb\u4f5c\u6587\u6642\u76f4\u63a5\u5f15\u7528\u6210\u8a9e\u300c\u585e\u7fc1\u5931\u99ac\u300d\uff0c\u4e0d\u4f46\u8868\u9054\u7c21\u6f54\u6709\u529b\uff0c\u9019\u500b\u6210\u8a9e\u9084\u53ef\u4ee5\u62ff\u7d66\u5176\u4ed6\u4f5c\u6587\u4f7f\u7528\u3002"}]}',null)
B.xB=new A.a9('{ "items" : [\n    {"type" : 1, "content" : "\u6587\u5b57\u4e00\u96f6\u96f6\u4e0d\u662f\u6578\u503c\u4e00\u767e\uff0c\u963f\u62c9\u4f2f\u6578\u5b57 \\"100\\" \u4e0d\u662f\u6578\u503c 100\u3002\u540c\u7406\uff0c"},\n    {"type" : 2, "content" : "\u5c0d\u96fb\u8166\u4f86\u8aaa\uff0c\u6587\u5b57\u8207\u6578\u503c\u662f\u4e0d\u4e00\u6a23\u7684\u8cc7\u6599\u3002\u5728 JavaScript \u9019\u500b\u7a0b\u5f0f\u8a9e\u8a00\uff0c\u6578\u503c\u8cc7\u6599\u76f4\u63a5\u4ee5\u963f\u62c9\u4f2f\u6578\u5b57\u64b0\u5beb\uff0c\u6587\u5b57\u8cc7\u6599\u5247\u9700\u8981\u653e\u5728\u4e00\u5c0d\u96d9\u5f15\u865f (\\"\\") \u7576\u4e2d\u3002"},\n    {"type" : 1, "content" : "\u4f8b\u5982\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let x = 100; // x \u662f\u6578\u503c\u8cc7\u6599\u4e00\u767e"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          let y = \\"100\\"; // y \u662f\u6587\u5b57\u8cc7\u6599\u4e00\u96f6\u96f6"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u6578\u5b78\u8ab2\u6559\u904e\u6578\u503c\u52a0\u6cd5\uff0c\u4f8b\u5982 100 + 100 = 200\uff0c\u4f46\u570b\u6587\u8ab2\u53ef\u80fd\u6c92\u6709\u5b9a\u7fa9\u6587\u5b57\u4e00\u96f6\u96f6\u52a0\u6587\u5b57\u4e00\u96f6\u96f6\u7b49\u65bc\u4ec0\u9ebc\u3002JavaScript \u5b9a\u7fa9\u6587\u5b57\u52a0\u6cd5\u4ee3\u8868\u6587\u5b57\u929c\u63a5\u3002\u4f8b\u5982 \\"100\\" + \\"100\\" \u7684\u7d50\u679c\u662f \\"100100\\"\u3002\u7531\u65bc\u6587\u5b57\u5728\u7a0b\u5f0f\u5167\u53ef\u4ee5\u50cf\u4e32\u73e0\u822c\u5c07\u6587\u5b57\u4e00\u500b\u63a5\u4e00\u500b\u4e32\u8d77\u4f86\uff0c\u6240\u4ee5"},\n    {"type" : 2, "content" : "\u5728\u96fb\u8166\u79d1\u5b78\u9818\u57df\uff0c\u4f7f\u7528\u5b57\u4e32 (string) \u9019\u500b\u5c08\u696d\u8853\u8a9e\u4f86\u6307\u7a31\u53ef\u4ee5\u4e32\u63a5\u7684\u6587\u5b57\u8cc7\u6599\u3002"},\n    {"type" : 1, "content" : "\u5f80\u5f8c\u7684\u8ab2\u7a0b\u88e1\uff0c\u5c07\u4e00\u5f8b\u4f7f\u7528\u300c\u5b57\u4e32\u300d\u4f86\u4ee3\u8868\u96fb\u8166\u4e2d\u7684\u6587\u5b57\u8cc7\u6599\u3002"}]}',null)
